import {useState} from "react";
import {createId} from "./lib/createId";


const useTags =() => {
    const [_tags, _setTags] = useState<string[]>(['餐饮','房租','服装','娱乐','旅行','美容','汽车','饮品','宠物','购物','度假','医疗']);
    const [tags, setTags] = useState<{ id:number;name:string }[]>([
        {id:createId(),name:'餐饮'},
        {id:createId(),name:'房租'},
        {id:createId(),name:'服装'},
        {id:createId(),name:'娱乐'},
        {id:createId(),name:'旅行'},
        {id:createId(),name:'美容'},
        {id:createId(),name:'汽车'},
        {id:createId(),name:'饮品'},
        {id:createId(),name:'宠物'},
        {id:createId(),name:'购物'},
        {id:createId(),name:'度假'},
        {id:createId(),name:'医疗'},
        ]);
    const iconMap:{[k:string]:string} ={
        1:'餐饮',
        2:'房租',
        3:'服装',
        4:'娱乐',
        5:'旅行',
        6:'美容',
        7:'汽车',
        8:'饮品',
        9:'宠物',
        10:'购物',
        11:'度假',
        12:'医疗'
    };
    return{tags,setTags,iconMap}
}
export {useTags};
